INSERT INTO `activity_board` VALUES ('1', '充值送豪礼', '【活动内容】活动期间充值任意金额（月卡为30元）即可获得不同档次的礼包\\n【活动奖励】\\n单笔充值任意金额：[00ffff]召唤兽：虎王、铜钱X5000、清风掌X3[-] \\n单笔充值30元：[00ffff]铜钱X8000、清风掌X5、召唤术X5、金钟罩X5 [-]\\n单笔充值60元：[00ffff]铜钱X18888、清风掌X15、召唤术X15、金钟罩X15、火焰拳X15[-]\\n单笔充值100元：[00ffff]铜钱X40000、清风掌X25、召唤术X25、金钟罩X25、火焰拳X25[-]\\n单笔充值300元：[00ffff]铜钱X100000、清风掌X80、召唤术X80、金钟罩X80、火焰拳X80[-]\\n单笔充值1000元：[00ffff]召唤兽：苍龙、铜钱X200000、清风掌X100、召唤术X100、金钟罩X100、火焰拳X100[-]\\n【领取方式】[ff0000]主界面左下角功夫小鸟中的活动面板领取[-]', '2014-12-10 00:00:00', '2014-12-31 00:00:00', 'http://203.195.199.202:7000/img/changgui_1.png', '1', '充值大回馈', '0');
INSERT INTO `activity_board` VALUES ('3', '常规活动', '【活动内容】活动期间每日无尽模式下达到相应的分数即可领取奖励 \\n【活动奖励】\\n达到50000分:[00ffff]铜钱X1000、轻功强化X3[-] \\n达到100000分:[00ffff]铜钱X3000、体力强化X5、轻功强化X5[-] \\n达到200000:[00ffff]铜钱X5000、无敌秘术X5、防护罩X5、绝处逢生X5[-]\\n【领取方式】[ff0000]主界面左下角功夫小鸟中的活动面板领取[-]', '2014-12-10 00:00:00', '2014-12-31 00:00:00', 'http://203.195.199.202:7000/img/changgui_1.png', '1', '每日铜币跑就送', '0');
INSERT INTO `activity_board` VALUES ('4', '超越梦想', '【活动内容】活动期间累计超越一定数量的玩家，即可获得大礼包 \\n【活动奖励】\\n初级礼包（累计超越10名玩家）[00ffff]铜钱X3000、清风掌X1[-] \\n中级礼包（累计超越20名玩家）[00ffff]铜钱X5000、清风掌X2、金钟罩X2[-] \\n高级礼包（累计超越50名玩家）[00ffff]铜钱X8000、清风掌X3、金钟罩X3、召唤术X3[-]\\n特级礼包（超越100名玩家）[00ffff]如意珠X10、铜钱X10000[-]\\n【领取方式】[ff0000]主界面左下角功夫小鸟中的活动面板领取[-]', '2014-12-10 00:00:00', '2014-12-31 00:00:00', 'http://203.195.199.202:7000/img/jiri_1.png', '1', '节日活动', '0');
INSERT INTO `activity_board` VALUES ('5', '不死鸟出征', '【活动内容】活动期间在无尽模式中达到50000分[ff0000]（不可复活）[-]即可获得挑战礼包 \\n【活动奖励】\\n挑战准备礼包（按照要求达到50000分）[00ffff]铜钱X4000、清风掌X1[-] \\n挑战准备礼包（按照要求达到100000分）[00ffff]铜钱X8000、清风掌X2、金钟罩X2[-] \\n挑战准备礼包（按照要求达到200000）[00ffff]铜钱X16000、清风掌X3、金钟罩X3、召唤术X3[-]\\n【领取方式】[ff0000]主界面左下角功夫小鸟中的活动面板领取[-]', '2014-12-10 00:00:00', '2014-12-31 00:00:00', 'http://203.195.199.202:7000/img/teshu_1.png', '1', '特殊活动', '0');
INSERT INTO `activity_board` VALUES ('6', '开服送iphone6', '【挑战内容】活动期间无尽模式中获得最高积分的玩家即可获得奖励\\n【挑战规则】玩家在无尽模式中使用任意方式[ff0000]包括使用复活[-]，最终结果为比赛结束前按照规则条件下获得积分按从多到少进行全服排名。若未满足上述条件则失败。前10名的奖励必须先达到全民奖励的条件，否则无效。\\n【挑战奖励】\\n第1名：[ff0000]iphone 6一部[-]\\n第2-5名：[00ffff]如意珠X200[-]\\n第5-10名：[00ffff]如意珠X100[-]\\n全民奖励（达到100000分）：[00ffff]如意珠X20[-]\\n[ff0000]注释：所有奖励将于活动后3个工作日内统一发放。[-]\\n[ff0000]奖励将在微社区官网微信[00ffff]kungfubird[-]中公布[-]', '2014-12-10 00:00:00', '2014-12-16 23:59:59', 'http://203.195.199.202:7000/img/tiaozhan_1.png', '1', '挑战活动：宁死不屈', '0');
INSERT INTO `activity_board` VALUES ('7', '每日挑战排行', '【宁死不屈】排名奖励', '2014-12-17 00:00:00', '2014-12-31 00:00:00', 'http://203.195.199.202:7000/img/paihang_1.png', '1', '排行', '1');
INSERT INTO `activity_board` VALUES ('8', '截图送iPhone6', '【活动内容】开服期间，玩家只要将游戏的截图发到《功夫小鸟》百度贴吧或者微社区并注明自己的账号，即可获得5点如意珠（如意珠可用于购买游戏中的付费道具）的奖励。其中[ff0000]8楼、88楼、888楼[-]的玩家还可获得高端大气上档次的iPhone6一部！\\n注：每个账户只可获得一次奖励。\\n贴吧：百度贴吧搜索“[00ffff]功夫小鸟[-]”即可进入功夫小鸟百度贴吧；关注后并在活动贴发送截图即可。\r\n微社区：关注功夫小鸟官方微信“[00ffff]kungfubird[-]”进入功夫小鸟微社区，并活动贴发送截图即可。', '2014-12-10 00:00:00', '2014-12-31 00:00:00', 'http://203.195.199.202:7000/img/iphone_activity.png', '1', 'iphone6', '0');
INSERT INTO `activity_board` VALUES ('2', '常规活动', '【活动内容】活动期间每日分享任意内容至微信即可活动每日分享礼包（限一次）\\n【活动奖励】[00ffff]铜钱X2000、如意珠X1[-]\\n【领取方式】[ff0000]主界面左下角功夫小鸟中的活动面板领取[-]', '2014-12-10 00:00:00', '2014-12-31 00:00:00', 'http://203.195.199.202:7000/img/changgui_1.png', '1', '每日分享', '0');
