INSERT INTO `basetask` VALUES ('100', '升级神兽', '升级一次召唤兽\\n召唤兽，传说中的存在，感恩于小鸟的\\n帮助，于是决定在关键时刻助小鸟一臂\\n之力。强大的力量使得它无敌天下，所\\n向披靡，拥有高等级的召唤兽也是身份\\n的象征！', '2', '2', '1', '200,3000', 'img', '-1');
INSERT INTO `basetask` VALUES ('101', '购买装备', '购买一件装备\\n合身的装备，不仅能给你别样的外观，\\n增加你的魅力，更能大幅提升你的各项属\\n性。据说这里的装备都是黑道销赃的，\\n所以特别便宜，错过了你可没处后悔去！', '2', '3', '1', '200,2000', 'img', '-1');
INSERT INTO `basetask` VALUES ('102', '升级装备', '升级任意装备两次\\n瞧瞧你这一身装备，太不起眼了，怎么\\n能体现出你高贵的身份？装备升级到一\\n定程度可是能改变外观的哦，想看看你\\n的小鸟到底能散发多大魅力吗？升级一\\n下就知道！', '2', '4', '2', '200,2000', 'img', '-1');
INSERT INTO `basetask` VALUES ('103', '购买技能', '购买两个技能\\n冲锋陷阵中，不来一套技能防身怎么行\\n，师父教的功夫全在这里体现了。师傅\\n说技能用多了会更厉害，相信师父不会\\n骗我，赶快去买两个试试！', '2', '5', '2', '200,2000', 'img', '-1');
INSERT INTO `basetask` VALUES ('104', '饱餐一顿', '累计获得10个饭团\\n肚子饿了，没体力了，这时候要是有个\\n饭团吃吃改多好。哇，还真有这么多饭\\n团啊，真的要饱餐一顿了，精神饱满才\\n。。。。。', '2', '38', '10', '200,1500', 'img', '-1');
INSERT INTO `basetask` VALUES ('105', '升级角色', '升级角色两次\\n据说有一种神奇的方法可以加速小鸟的\\n成长，成长之后的小鸟更强壮，更勇敢\\n，师傅说这个方法就是升级，还有这么\\n简单的方法？那得赶紧试试看。', '2', '7', '2', '200,3000', 'img', '-1');
INSERT INTO `basetask` VALUES ('106', '三星通关', '两次三星通关关卡\\n通关其实并不难，但也没有你想象中那\\n么简单，特别是如果你想要获得三颗星\\n的话，这会是一个艰难的过程。勇者总\\n是无所畏惧的，做好这个准备的话，就\\n来挑战一番吧！', '2', '8', '2', '200,2000', 'img', '-1');
INSERT INTO `basetask` VALUES ('107', '破墙高手', '击碎500堵墙壁\\n不知道是谁在这里摆下了这么多堵墙壁\\n，对我的铁拳而言，这些都如纸片般不\\n堪一击，传说曾有个勇士一口气击碎了500\\n堵墙，我看看我能击碎多少。', '2', '10', '500', '200,5000', 'img', '-1');
INSERT INTO `basetask` VALUES ('108', '清除小鸟（累计）', '清除炮兵小鸟10只\\n比铁锤跟火球更讨厌的就是这炮兵小鸟\\n，他们的炮弹避无可避，更为可恶的是\\n，同为小鸟他们竟然帮敌人做事！决不\\n能容忍他们的背叛，赶快消灭他们！', '2', '11', '10', '200,4000', 'img', '-1');
INSERT INTO `basetask` VALUES ('109', '飘飘欲仙（累计）', '使用轻功总时间超过50秒\\n师父曾教授了一招十分有用的招式——\\n轻功，使用轻功翱翔天际的感觉让我倍\\n感舒适与畅快，只是功力不够，无法长\\n时间飞行，但这短短的50秒还是不在话\\n下的。', '2', '12', '50', '200,2000', 'img', '-1');
INSERT INTO `basetask` VALUES ('110', '超越对手（累计）', '游戏内超越10名玩家\\n什么，超越10名玩家？你这是看不起我\\n吗！我可是年轻一代的翘楚，区区10名\\n，简直是在侮辱我，赶快更改数据，来\\n个11名的，我分分钟超越给你看！', '2', '13', '10', '200,2000', 'img', '-1');
INSERT INTO `basetask` VALUES ('111', '蹦蹦跳跳（累计）', '累计跳跃50次\\n那天饭团吃多了，不知为什么老打嗝，\\n有人建议我跳几下就好了，所以我就跳\\n啊跳啊，一直跳到现在，似乎打嗝是止\\n住了，但我跳得停不下来了，谁来救救我！', '2', '14', '50', '200,3000', 'img', '-1');
INSERT INTO `basetask` VALUES ('112', '我能瞬移（累计）', '瞬间移动30次\\n最喜欢用着一招了，恶作剧可以不留痕\\n迹。昨天跟人打赌，我说能拔下师父的\\n一个白胡子，结果瞬移走之后被师傅的\\n瞬移追上了，罚跪到现在。。。。。。', '2', '15', '30', '200,3000', 'img', '-1');
INSERT INTO `basetask` VALUES ('113', '无敌天下（累计）', '累计使用天下无敌20次\\n与召唤兽配合完成的一招，威力强大，\\n据说可以通过升级装备与召唤兽来增加\\n持续时间。师傅说轻易不要使用，威力\\n太大，怕吓坏小朋友。', '2', '16', '20', '200,2000', 'img', '-1');
INSERT INTO `basetask` VALUES ('114', '我是有钱人', '累计获得4000铜钱\\n师父偶尔给的零用钱哪里够我的开销啊\\n，看来想赚钱还得靠自己，据说可以捡\\n如意珠换钱，也可以到关卡里捡钱币，\\n我要捡好多，到时候我就是有钱人了，呵呵。', '2', '18', '4000', '200,1000', 'img', '-1');
INSERT INTO `basetask` VALUES ('115', '抓住福袋', '攻击福袋20次\\n昨晚听师父大叫一声，据说他珍藏多年\\n的福袋跑了，以前听师父说过，那福袋\\n里可藏了不少好东西，现在必须早点帮\\n师父找到，顺便自己先偷偷藏点。。。。。', '2', '19', '20', '200,2000', 'img', '-1');
INSERT INTO `basetask` VALUES ('116', '疯狂拳击', '连续击破达到150次\\n上一届武术大会的终极比赛就是看你能\\n连续击碎多少墙壁，现在时间还早，正\\n好在这里练习一下，听说这届的学员里\\n已经有人能打150堵了，我要超越他！！', '2', '20', '150', '200,2000', 'img', '-1');
